import React from 'react';

class Message extends React.Component{
    constructor() {
        super();
        this.state = {
            errorMessage: '',
            page: ''
        }

        this.changePage = this.changePage.bind(this);

    }

    changePage =  (page) => {
        this.setState({
            page: page
        })
    }

    render() {

        const home =
            <h1>
                Message Page
            </h1>

        return (home);
    }
}

export default Message;
